import React from "react";
import CartItem from "./cartitem";
import { useSelector } from "react-redux";



export default function CartItemContainer({myCart, setMyCart, setSelectedMenu, menuItems, setMenuItem}){

    const myItems = useSelector(state => state) 
    console.log(myItems)
    return(

        myItems.length>0 ? 
        myItems.map(item=>{
            return <CartItem key={item.name} id={item.price} name={item.name} amount={item.amount} price={item.price}
                    setSelectedMenu={setSelectedMenu}
                    menuItems={menuItems} setMenuItem={setMenuItem}
                    />
        }) : null
    )
}
